import { useEffect, useState } from "react";
import axios from 'axios';
import Button from '@material-ui/core/Button';



export default function VideoList(props)
{
    const{setUrl} = props;
    const [files,setFiles] = useState([]);
    useEffect(()=>{
        axios.get('/videoFs/getAllVideos')
        .then(res=>res.data)
        .catch(err=>console.log(err))
        .then(res=>{
            let temp = [];
            for(let i=0;i<res.length;i++)
            {
                temp.push(res[i]);
            }
            setFiles(temp);
        })

    },[])   

    function handleChooseMovie(filename)
    {
      const fileUrl = "/videoFs/"+filename;
      setUrl(fileUrl);
    }

    return<div>
        {files.map(file=>{
            return<Button variant="outlined" onClick={()=>handleChooseMovie(file.filename.filename)}>{file.filename.customname}</Button>    
        })}
       
    </div>

}
